// ResultPage.jsx

import React from "react";
import { useLocation, useNavigate } from "react-router-dom";
import "./ResultPage.css";

const ResultPage = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const reason = location.state?.reason;

  const isViolation = reason === "VIOLATION_LIMIT";

  return (
    <div className="result-page">
      <div className="result-container">
        <div className={`result-card ${isViolation ? 'result-violation' : 'result-success'}`}>
          {/* Icon */}
          <div className={`result-icon-wrapper ${isViolation ? 'icon-violation' : 'icon-success'}`}>
            {isViolation ? (
              <svg className="result-icon" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 9v2m0 4h.01m-6.938 4h13.856c1.54 0 2.502-1.667 1.732-3L13.732 4c-.77-1.333-2.694-1.333-3.464 0L3.34 16c-.77 1.333.192 3 1.732 3z" />
              </svg>
            ) : (
              <svg className="result-icon" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
              </svg>
            )}
          </div>

          {/* Content */}
          <div className="result-content">
            <h2 className="result-title">
              {isViolation
                ? "Test Auto-Submitted"
                : "Test Submitted Successfully"}
            </h2>

            <p className="result-message">
              {isViolation
                ? "Your test was automatically submitted because the violation limit was reached. Multiple integrity violations were detected during your assessment."
                : "Thank you for completing the test. Your responses have been recorded and will be reviewed by our team."}
            </p>

            {isViolation && (
              <div className="violation-notice">
                <svg className="notice-icon" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 16h-1v-4h-1m1-4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
                </svg>
                <span>This may affect your assessment results</span>
              </div>
            )}

            {/* Info Box */}
            <div className="info-box">
              <div className="info-item">
                <span className="info-label">Status:</span>
                <span className={`info-value ${isViolation ? 'status-warning' : 'status-success'}`}>
                  {isViolation ? "Auto-Submitted" : "Completed"}
                </span>
              </div>
              <div className="info-item">
                <span className="info-label">Submission Time:</span>
                <span className="info-value">
                  {new Date().toLocaleString()}
                </span>
              </div>
            </div>

            {/* Action Button */}
            <button
              type="button"
              onClick={() => navigate("/")}
              className="home-button"
            >
              <svg className="button-icon" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 12l2-2m0 0l7-7 7 7M5 10v10a1 1 0 001 1h3m10-11l2 2m-2-2v10a1 1 0 01-1 1h-3m-6 0a1 1 0 001-1v-4a1 1 0 011-1h2a1 1 0 011 1v4a1 1 0 001 1m-6 0h6" />
              </svg>
              Back to Home
            </button>
          </div>
        </div>

        {/* Footer */}
        <div className="result-footer">
          <p className="footer-note">
            {isViolation 
              ? "If you believe this was a mistake, please contact support."
              : "You will be notified of your results via email."}
          </p>
        </div>
      </div>
    </div>
  );
};

export default ResultPage;
